import React from 'react';
class SongListTestB extends React.Component {
 
  constructor (props) {
    super (props)
 
    this.mijnInfo = {
      songs: [
        {title: 'Perfect', artist: 'Ed Sheeran', link: 'https://www.youtube.com/watch?v=emcFmUm5jtQ'},
        {title: 'There is moonshine', artist: 'Bill Night', link: 'https://www.youtube.com/watch?v=CYT2z11j-f8'},
        {title: 'Far to Good', artist: 'John Smith', link: 'https://www.youtube.com/watch?v=UBczT73O8sg'}
      ],
      filter : 'ee' 
    }
  }
 
  render () {
    return (   
          
             this.mijnInfo.songs.map((item)=> {
                return <li>{item.artist} </li>
          })     
    );
  }
}
 
export default SongListTestB;
